import React from 'react';
//import { useNavigate  } from 'react-router-dom';
import { Col, Row, Container, Form } from 'react-bootstrap';
import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

//import Swal from 'sweetalert2';
//import axios from 'axios';

const Profile = () =>{

    return(
        <Container className='col-sm-6'>
            <Row>
                <Col><Form.Label>First Name:</Form.Label><Form.Label>First Name:</Form.Label></Col>
                <Col><button type="button" class="btn btn-primary btn-sm">Update</button></Col>
            </Row>
            <Row>
                <Col><Form.Label>Last Name:</Form.Label></Col>
                <Col><Form.Label>First Name:</Form.Label></Col>
                <Col><button type="button" class="btn btn-primary btn-sm">Update</button></Col>
            </Row>
            <Row>
                <Col><Form.Label>Email Address:</Form.Label></Col>
                <Col><Form.Label>First Name:</Form.Label></Col>
                <Col><button type="button" class="btn btn-primary btn-sm">Update</button></Col>
            </Row>
        </Container>
        
    );
}
export default Profile;
